import React from "react";
import {Col, Row, FormGroup, Label, Button, ModalBody, ModalFooter, CustomInput} from "reactstrap";
import Translate from "../../../Translate";

const UserModal = (props) => {
    const pages = props.pages;

    function handleInputChange(key, value) {
        let new_value = {}
        new_value[key] = value
        props.setModalValues(new_value)
    }

    function handleCheck() {
        console.log("gsdgd")
    }

    function handleClick() {
        props.addUser(props.user)
    }

    console.log(props.pages)
    return (
        <React.Fragment>
            <ModalBody>
                <Row>
                    <Col md="12">
                        <FormGroup>
                            <Label for="firstName"><Translate name="name"/></Label>
                            <input
                                className="form-control"
                                type="text"
                                id="name"
                                onChange={event => handleInputChange("name", event.target.value)}
                                required
                            />
                        </FormGroup>
                    </Col>
                    <Col md="12">
                        <ul className="list-group icheck-task">
                            {Object.entries(pages).forEach(([key,value])=>{
                                console.log(`${key}:${value}`)
                            })};
                            {Object.keys(pages).forEach(key => {
                                {/*<li className={"list-group-item list-group-item-action no-border  bg-lighten-4"}>*/
                                }
                                {/*    <Row className="todo-list-group-item">*/
                                }
                                {/*        <Col xl={1} xs={1}>*/
                                }
                                {/*            <Label check>*/
                                }
                                {/*                <CustomInput type="checkbox" id={key}*/
                                }
                                {/*                             onClick={() => handleCheck()}/>*/
                                }
                                {/*            </Label>*/
                                }
                                {/*        </Col>*/
                                }
                                {/*        <Col xl={10} xs={9}>*/
                                }
                                {/*            <p className="mb-0 font-small-3">{pages[key].name}</p>*/
                                }
                                {/*        </Col>*/
                                }
                                {/*    </Row>*/
                                }
                                {/*</li>*/
                                }

                            })};
                        </ul>
                    </Col>

                </Row>


            </ModalBody>
            <ModalFooter>
                <Button color="primary" type="submit" onClick={handleClick}>
                    <Translate name="confirm"/>
                </Button>
            </ModalFooter>
        </React.Fragment>
    );

};

export default UserModal;
